import 'package:equatable/equatable.dart';

import 'table.dart';

class Standing extends Equatable {
  final String? stage;
  final String? type;
  final dynamic group;
  final List<Tables>? table;

  const Standing({this.stage, this.type, this.group, this.table});

  factory Standing.(
      Map<String, dynamic> json) {
    return Standing(
      stage: json['stage'] as String?,
      type: json['type'] as String?,
      group: json['group'] as dynamic,
      table: (json['table'] as List<dynamic>?)
          ?.map((e) => Tables
              .(
                  e as Map<String, dynamic>))
          .toList(),
    );
  }

  Map<String, dynamic>
      () {
    return {
      'stage': stage,
      'type': type,
      'group': group,
      'table': table
          ?.map((e) => e
              .())
          .toList(),
    };
  }

  @override
  List<Object?> get props => [stage, type, group, table];
}
